import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";



const  PrivateRoute =({
        userConnected, ...rest
}) =>{
    return (
      <Route
        {...rest}
        render={(props) => userConnected === true
          ? <Component {...props} />
          : <Redirect to={{pathname: '/login', state: {from: props.location}}} />}
      />
    )
  }

  export default PrivateRoute
